import React from "react";
import classnames from "classnames";
import ButtonPrimary from "../../1-atoms/Buttons/Primary";
import ButtonSecondary from "../../1-atoms/Buttons/Secondary";
import { ReactComponent as SandClock } from "../../1-atoms/Icons/24px/Sandclock.svg";

interface ResponseTimeProps {
  // text?: string;
  // techBlock: boolean;
}

const ResponseTime: React.FC<
  ResponseTimeProps & React.AllHTMLAttributes<HTMLDivElement>
> = ({ ...props }) => {
  return (
    <section {...props} className={classnames("px-[30px]", props.className)}>
      <ButtonSecondary className={"w-[198px]"}>
        <SandClock className={"mr-[3px]"} />
        Response time: <span className={"font-bold"}>2 mins</span>
      </ButtonSecondary>
      <ButtonPrimary className={"w-[184px] mx-auto"}>
        Protect me now
      </ButtonPrimary>
    </section>
  );
};

export default ResponseTime;
